import { useState } from 'react'



const linkStyle = {
    background: "#F3F3F3", 
    height: "100px",
    width: "100px"
  };

export default function Index() {
    const [rInput, setRInput] = useState(200)
    return (
      <div style={linkStyle}>
        <p>Hello Next.js</p>

        <p>Red</p>
        {rInput}

        <input 
        type="text"
        placeholder = "Enter R value"
        onChange = {(e) => setRInput(e.target.value)}
        />


      </div>
    );
  }
